      var result: Pilot[] = []
      for (const pilot of this.pilots) {
        var ok = true
        if (ok && filter?.Health === "OnlyHealthy") {
          ok = pilot.Health === "Healthy"
        }
        if (ok && filter?.Health === "NoDead") {
          ok = pilot.Health != "Dead"
        }
        if (ok && filter?.Country) {
          ok = pilot.Country === filter.Country
        }
        if (ok) {
          result.push(pilot)
        }
      }
      return result
